import React, { Component } from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import Particles from 'react-particles-js';
import SkillBar from 'react-skillbars';
import birds from './imgs/delete.svg'
import { binary, mGlass, computer, element } from './imgs'
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

const skills = [
  {
    "type": "Java",
    "level": 100,
    "color": {
      "bar": "#3498db",
      "title": {
        "text": "#fff",
        "background": "#2980b9"
      }
    }
  },
  {
    "type": "React",
    "level": 85,
    "color": {
      "bar": "#4288d0",
      "title": {
        "text": "#fff",
        "background": "#124e8c"
      }
    }
  },
  {
    "type": "Javascript",
    "level": 75,
    "color": {
      "bar": "#2c3e50",
      "title": {
        "text": "#fff",
        "background": "#2c3e50"
      }
    }
  },
  {
    "type": "Spring",
    "level": 50,
    "color": {
      "bar": "#5a68a5",
      "title": {
        "text": "#fff",
        "background": "#46465e"
      }
    }
  },
  {
    "type": "Docker",
    "level": 25,
    "color": {
      "bar": "#525252",
      "title": {
        "text": "#fff",
        "background": "#333333"
      }
    }
  },
  {
    "type": "HTML",
    "level": 20,
    "color": {
      "bar": "black",
      "title": {
        "text": "#111",
        "background": "#fff"
      }
    }
  },
  {
    "type": "NoSQL",
    "level": 0,
    "color": {
      "bar": "#2ecc71",
      "title": {
        "text": "#fff",
        "background": "#27ae60"
      }
    }
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="container-fluid" style={{ padding: "0px",}}>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">Clay Palumbo</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="#">About</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#">Applications</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Social Pages
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                  <NavLink href="https://github.com/kelptape" target="_blank">Github</NavLink>
                  </DropdownItem>
                  <DropdownItem>
                  <NavLink href="https://www.linkedin.com/in/clay-palumbo/" target="_blank">LinkedIn</NavLink>
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
        <div className="App" >
          <Particles
            params={{
              "particles": {
                "number": {
                  "value": 100
                },
                "size": {
                  "value": 3
                },
              },
              "color": {
                "value": "black"
              },
              "interactivity": {
                "events": {
                  "onhover": {
                    "enable": true,
                    "mode": "repulse"
                  },
                  "onclick": {
                    "enable": true,
                    "mode": "push"
                  }
                }
              }
              // "fps_limit": 28,
              // "particles": {
              //   "number": {
              //     "value": 200,
              //     "density": {
              //       "enable": false
              //     }
              //   },
              //   "line_linked": {
              //     "enable": true,
              //     "distance": 30,
              //     "opacity": 0.4
              //   },
              //   "move": {
              //     "speed": 1
              //   },
              //   "opacity": {
              //     "anim": {
              //       "enable": true,
              //       "opacity_min": 0.05,
              //       "speed": 2,
              //       "sync": false
              //     },
              //     "value": 0.4
              //   }
              // },
              // "polygon": {
              //   "enable": true,
              //   "scale": 0.5,
              //   "type": "inline",
              //   "move": {
              //     "radius": 10
              //   },
              //   "url": birds,
              //   "inline": {
              //     "arrangement": "equidistant"
              //   },
              //   "draw": {
              //     "enable": true,
              //     "stroke": {
              //       "color": "rgba(255, 255, 255, .2)"
              //     }
              //   }
              // },
              // "retina_detect": false,
              // "interactivity": {
              //   "events": {
              //     "onhover": {
              //       "enable": true,
              //       "mode": "bubble"
              //     }
              //   },
              //   "modes": {
              //     "bubble": {
              //       "size": 6,
              //       "distance": 40
              //     }
              //   }
              // }

            }}
            style={{
              width: '100%',
              // backgroundImage: `url(${binary})`
              background: `linear-gradient(rgba(38, 38, 38, 0.3), rgba(38, 38, 38, 0.5)), url(${binary})`
            }}
          />
          <div className="row text-center" style={{ margin: "20px" }}>
          <div className="col-1">
          </div>
            <Card className="col-3" style={{ margin: "20px", padding: "20px", border: "none" }}>
              <CardImg top width="10%" src={element} alt="Card image cap" />
              <CardBody>
                <CardTitle style={{color: "#dc3545", fontSize: "24px"}}>Innovative Engineer</CardTitle>
                <CardText>Offering experience in the full software development lifecycle – from concept to production in developing modern applications and customizable solutions.</CardText>
              </CardBody>
            </Card>
            <Card className="col-3" style={{ margin: "20px", padding: "20px", border: "none"  }}>
              <CardImg top width="10%" src={computer} alt="Card image cap" style={{ height: "5px !important" }} />
              <CardBody>
                <CardTitle>Card title</CardTitle>
                <CardSubtitle>Card subtitle</CardSubtitle>
                <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
                <Button>Button</Button>
              </CardBody>
            </Card>
            <Card className="col-3" style={{ margin: "20px", padding: "20px", border: "none"  }}>
              <CardImg top width="10%" src={mGlass} alt="Card image cap" />
              <CardBody>
                <CardTitle>Card title</CardTitle>
                <CardSubtitle>Card subtitle</CardSubtitle>
                <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
                <Button>Button</Button>
              </CardBody>
            </Card>
          </div>
          <div className="row">
            <div className="col-6">
            </div>
            <div className="col-6">
              <SkillBar
                skills={skills}
                animationDelay={0}
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}


export default App;
